import React from "react";
import { Box } from "@mui/material";

const FlightLogs = () => {
  return (
    <>
      <Box
        style={{
          borderTop: "1px solid #f59331",
          width: "80%",
          height: "100px",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          marginBottom: "15px",
          position: "relative", // This is added to make sure the inner Box is positioned with respect to this Box
        }}
      >
        <Box
          style={{
            position: "absolute",
            top: "0", // Position it at the top of the outer Box
            left: "50%", // Start at the horizontal center
            transform: "translate(-50%, -100%)", // This will shift it to the left by half of its width, and shift it up by its full height
            backgroundColor: "#181818",
            padding: "0 7px",
            zIndex: 1,
            fontSize: "25px",
          }}
        >
          Logs
        </Box>
      </Box>
    </>
  );
};

export default FlightLogs;
